import React from "react";
import {NavLink} from 'react-router-dom';
const Menu = () => {
  return(
      <>
      <NavLink ac to='/' >AboutUS</NavLink>
      <NavLink to='/Contact'>Contact</NavLink>
      <br/><br/>
         <a href="/">AboutUS</a>
         <a href="/Contact">Contact</a>
      </>
  );
};

export default Menu;
